	// LU factorization from LAPACK
	function luPack() {
	    var lu = lapack.lu(this.elements);
	    return {
		L: $M(lu.L),
		U: $M(lu.U),
		P: $M(lu.P)
		// don't pass back IPIV
	    };
	}

